import HomeImage from '../components/images/home/homeimage';


const Index = () => (
  <div className='md:flex bg-gray-200'>
        <div className='mx-12 md:mt-40'>
          <br/>
         <p className='text-blue-500 text-3xl font-medium'>Hello World, I am Shaurya Tuli a Front-end Dev</p>
     </div>
      <div className='my-8 md:w-2/4 md:mt-16 md:mx-auto'>
        <HomeImage/>
      </div>  
  </div>
)

export default Index;
